class Solution:
    def solveNQueens(self, n: int) -> List[List[str]]:
        ans = []
        for _ in range(10**7):
            g = [["." for _ in range(n)] for _ in range(n)]
            col = [0] * n
            dg = [0] * (n << 1)
            udg = [0] * (n << 1)
            for i in range(n):
                for j in range(n):
                    if i == 0 and j == 0:
                        g[i][j] = "Q"
                        col[j] = dg[i + j] = udg[n - i + j] = 1
                        break
                else:
                    continue
                break
            else:
                continue
            for i in range(1, n):
                j = 0
                while j < n:
                    if col[j] + dg[i + j] + udg[n - i + j] == 0:
                        g[i][j] = "Q"
                        col[j] = dg[i + j] = udg[n - i + j] = 1
                        break
                    j += 1
                else:
                    continue
                break
            else:
                continue
            for i in range(1, n):
                for j in range(n):
                    if col[j] + dg[i + j] + udg[n - i + j] != 0:
                        g[i][j] = "."
            ans.append(["".join(row) for row in g])
        return ans
